const picker = document.getElementById("bread");
let root = document.documentElement;
const name = document.getElementById("name");

picker.addEventListener("change", onClick, false);

function onClick(e) {
  const nearest = getNearestColour(e.target.value);
  const { H, S, L } = rgb2hsl(nearest.rgb);
  
  console.log("Values:", "rgb", nearest.rgb, "HSL", {H, S, L });
  
  root.style.setProperty('--bread-h', H);
  root.style.setProperty('--bread-s', S + "%");
  root.style.setProperty('--bread-l', L + "%");
  name.innerHTML = nearest.name;
}

